            let result = false

                sp = arr[i].split('?')

                    sp = sp[1].split('&')
                    for (let j = 0; j < sp.length; j++) {

                            break
                        }
                    }
                    if (result) {

                    }
                }
            }
            return result

            var sp = document.cookie.split(';')
            var result = []
            for (let i = 0; i < sp.length; i++) {

                if (sp2.length > 1) {
                    if (sp2[1] == 'k100_visited') {
                        result.push(sp2[0])
                    }
                }
            }
